def Tor():
    
    
    # Get index in order to get Random UserAgent
    index = random.sample(range(len(HeadersUserAgents)),1)[0] 
    
    myHeaders = { "Content-Type" : "text/html; charset=UTF-8"  ,
                 "User-Agent"     :  HeadersUserAgents[index] }
    
    
    url1 ="https://www.wikipedia.com"
    url2="https://sourceforge.net/directory/"
    
    # Post Parameters 
    data = {"q":"gfsdgsdfgsdfgsdfgsdfgsdf" }    
            
    
    # Configure session
    s = requests.session()    
    s.proxies['http']  = 'socks5h://127.0.0.1:9050'
    s.proxies['https'] = 'socks5h://127.0.0.1:9050'    

    try:
        # Get data    
        response = requests.get(url1,                             
                                headers = myHeaders)   
         
        print(f"GET Response code : {response.status_code}")    
        
        # Post data
        response= s.post(url2,  
                          data,                     
                          headers = myHeaders)    
        
        print(f"POST Response code : {response.status_code}")
    except BaseException as err:
        print(f"Catched Unexpected error {err=}, {type(err)=}")    
    

def main():
    
    Tor()
  
    
if __name__ == "__main__":
    main()
